import { Card, CardContent } from '@material-ui/core'
import React from 'react'

import imag4 from '../resurces/imag4.png'

export function ListCards({ card }) {
  return (
    <>
      <div style={{ display: 'flex' }}>
        {card.map((e, i) => (
          <Card sx={{ m: 5, flexDirection: 'column' }}>
            <p>{e.title}</p>
          </Card>
        ))}
      </div>
    </>
  )
}
